import './App.css';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

function App() {
  const commitment = ['acordar', 'tomar cafe', 'estudar', 'descansar', 'dormir'];
  const toReturn = commitment.map((element) => {
    Task(element);
  })
  return (
    toReturn
  );
}

export default App;
